import React from 'react';
import Title from "./Title.js"

function PostPage(props) {
    const { user, entry } = props;
    return (
        <div>
            <Title />
            <div>
                <h3>This post was made by {user}</h3>
                <p>{entry}</p>
            </div>
        </div>
    )
}

export default PostPage;
